import React, { Component } from "react";

export default class ListContacts extends Component {
  render() {
    console.log(this.props.contacts[2].id);
    return (
      <ol className="contact-list">
        {this.props.contacts.map(contact => (
          <li>{contact.name}</li>
        ))}
      </ol>
    );
  }
}
